export type Requester<C= {}> = <R, V>(doc: DocumentNode, vars?: V, options?: C) => Promise<R>
export function getSdk<C>(requester: Requester<C>) {
  return {
    Factory(variables?: FactoryQueryVariables, options?: C): Promise<FactoryQuery> {
      return requester<FactoryQuery, FactoryQueryVariables>(FactoryDocument, variables, options);
    }
  };
}
